import Link from "next/link";
import { Heading } from "@chakra-ui/core";

const AboutPage = () => {
  return (
    <div>
      <Heading as="h1" size="2xl">
        About page 2
      </Heading>
      <Link href="/">Home Page</Link>
    </div>
  );
};

export default AboutPage;
